import React, { useEffect, useRef } from "react";
import "./About.css";
import Splitting from "splitting";

const About = () => {
  useEffect(() => {
    const splitting = Splitting();
  }, []);

  return (
    <div>
      <div data-splitting>Splitting.js</div>
    </div>
  );
};

export default About;
